package main

import (
  "fmt"
  "strings"
)

type Tuple struct {
    letter rune
    result int
}

// var units = "dabAcCaCBAcCcaDA"
var units = ""

func main() {
    lowestLength := 99999
    bestRune := 'a'
    fmt.Printf(units+"\n")
    
    for i := 0; i < 26; i++ {
        result := letterRemover(units, rune(int('a')+i))
        // fmt.Printf("length:%d, phrase: %s \n", len(result), result)   


        result = remover(result)
        // fmt.Printf("length:%d \n", len(result))   
        if len(result) < lowestLength {
            lowestLength = len(result)
            bestRune = rune(int('a')+i)
        }
    }
    fmt.Printf("Best of the best: %d %v", lowestLength, string(bestRune))

}

func remover(str string) string {
    for i, v := range str {
        if i > 0 && v != rune(str[i-1]) && (strings.ToLower(string(v)) == string(str[i-1]) || strings.ToUpper(string(v)) == string(str[i-1])) {            
            str = str[0:i-1]+str[i+1:len(str)]
            
            // fmt.Printf("handling:  with length: %d \n ", len(str))
            break
        }
        if i+1 == len(str) {
            return str
        }
    }
    return remover(str)
    
}

func letterRemover(str string, r rune) string {
    // fmt.Printf("handling: %s\n", str)
    if i := strings.IndexRune(str, r); i > -1 {
        return letterRemover(string(str[0:i])+string(str[i+1:len(str)]), r)
    } else if i := strings.IndexRune(str, rune(strings.ToLower(string(r))[0])); i > -1 {
        return letterRemover(string(str[0:i])+string(str[i+1:len(str)]), rune(strings.ToLower(string(r))[0]))
    } else if i := strings.IndexRune(str, rune(strings.ToUpper(string(r))[0])); i > -1 {
        return letterRemover(string(str[0:i])+string(str[i+1:len(str)]), rune(strings.ToUpper(string(r))[0]))
    } else {
        return str
    }
}